package net.yozo.services.common;import net.yozo.core.dao.page.PagerModel;import java.io.Serializable;public class Favorite extends PagerModel implements Serializable {	private static final long serialVersionUID = 1L;	private String id;	private String account;	private String productID;	private String createtime;	private Integer topicId;		public void clear() {		super.clear();		id = null;		account = null;		productID = null;		createtime = null;		topicId = null;	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getAccount() {		return account;	}	public void setAccount(String account) {		this.account = account;	}	public String getProductID() {		return productID;	}	public void setProductID(String productID) {		this.productID = productID;	}	public String getCreatetime() {		return createtime;	}	public void setCreatetime(String createtime) {		this.createtime = createtime;	}	public Integer getTopicId() {		return topicId;	}	public void setTopicId(Integer topicId) {		this.topicId = topicId;	}}